import React from 'react';
import ToDoList from './ToDoList';

function App() {
  return (
    <>
      <ToDoList />
      <input type="text "/>
      <button>Add ToDo</button>
      <button>Clear completed</button>
      <div> 0 left to do</div>
    </>
  );
}

export default App;
